import React from 'react';
import './App.css';

export default function Services(){
    return(
        <section className='grid-container'>
            <div>Heading</div>
            <div>
            <div className='grid'><h2>1</h2><br/>ero</div>
            <div className='grid'><h2>2</h2><br/>mon</div>
            <div className='grid'><h2>3</h2><br/>pondor</div>
            <div className='grid'><h2>4</h2><br/>umbrella</div>
            </div>
            </section>
    )
}
